import React from "react";
import "../styles/NewProduct.css";

const NewProduct = () => {
  return (
    <div className="new-product">
      <div className="section">
        <h2 className="sub-title">New products</h2>
        <div className="products-container">
          <div className="product-component">
            <img
              className="new-product-image"
              src={require("../asset/new_product.jpg")}
              alt="new-product"
            ></img>
            <div className="product-name">plant</div>
            <div className="product-price">$100</div>
          </div>
          <div className="product-component">
            <img
              className="new-product-image"
              src={require("../asset/new_product2.jpg")}
              alt="new-product2"
            ></img>
            <div className="product-name">plant</div>
            <div className="product-price">$100</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default NewProduct;
